import React from 'react'
import { useGlobalContext } from '../context'


const People = () => {
    const { people, loading } = useGlobalContext()

    if (loading) {
        return <Loading />
    }

    if (people.length < 1) {
        return (
            <h2 className='section-title'>
                no Visitors matched your search criteria
            </h2>
        )
    }

    return (
        <div>People</div>
    )
}

export default People
